        The album was co-produced by Greg Kurstin, marking the first time the band
        have worked with outside producers. The band collaborated with David Stewart
        from Eurythmics and Matt Berninger from The National during production. The
        album was announced by Martin Doherty at the start of January 2018, with frontwoman
        Lauren Mayberry accidentally revealing the album's name in a since-deleted
        interview that same month.\\nAfter wiping their social media accounts, the
        band released the lead single, \\\"Get Out\\\", on 31 January. The track listing
        for the album was released two days before the next single, \\\"My Enemy\\\",
