        the album, \\\"Never Say Die\\\", was released on 29 March. \\\"Miracle\\\"
        was released as the fourth single on 10 April.\\nVideos were released for
        \\\"Get Out\\\", \\\"Miracle\\\", \\\"Out Of My Head\\\" and \\\"Graffiti\\\".\\nThe
